import React from 'react';

function Banner() {
    return 
        <header className="banner" style={{
            backgroundSize:"cover",
            backgroundImage: `url('https://images.unsplash.com/photo-1514483127413-f72f273478c3?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1000&q=80)'`,
            backgroundPosition: "center center"
        }}> 

        </header>;

};

export default Banner;
